import React, { Component } from 'react';

export default class AddProject extends Component {
    constructor(props){
        super(props);
        this.state = {
            name: '',
            tech: [],
            link: ''
        }
    }

    render() {
        return (
            <div className="primary col-8 main">
                <h1>My New thing</h1>
            </div>
        );
    }
}
